import { Col, Container, Row } from 'react-bootstrap';
import './App.css';
import NavigationBar from './component/NavigationBar';
import "./style/landingPage.css"
function App() {
  return (
    <div>
      {/* intro section */}
      <div className="myBG">
      <NavigationBar />
      <div className="intro">
        <Container className="text-p d-flex justify-content-center align-items-center">
          <Row>
            <Col>
            <div className="title">NONTON GRATIS</div>
            <div className="title">GAK PAKE KARCIS</div>
            </Col>
          </Row>

        </Container>
      </div>
      </div>
       {/* end of intro */}
    </div>
  );
}

export default App;
